import React from "react";
import { Link } from "react-router-dom";

const AdminDashboard = () => {
  return (
    <div>
      <h2>Admin Dashboard</h2>
      <nav>
        <ul>
          <li><Link to="/admin/manage-notes">Manage Notes</Link></li> {/* Fixed route */}
          <li><Link to="/admin/add-note">Add New Note</Link></li>
        </ul>
      </nav>
    </div>
  );
};

export default AdminDashboard;
